import React from "react";

function Header() {
    return (
      <header className="header">
          <a href="/" className="header__title"> <h1>NewsExplorer</h1> </a>
          <nav className="header__nav">
              <ui className="header__links">
                  <li>
                      <a href="#" className="header__link">Главная</a>
                  </li>
                  <li>
                      <a href="#" className="header__link">Сохраненные статьи</a>
                  </li>
                  <button className="header__log-button"> Авторизоваться </button>
              </ui>

          </nav>

      </header>
    );
  }

  export default Header;
